    render() {
        return(
            <div className="header-container">
                <nav className="navbar">
                    <ul>
                        <li><a href="#home"></a></li>
                        <li><a href="#about"></a></li>
                        <li><a href="#contact"></a></li>
                    </ul>
                </nav>
            </div>
        );
    }

}

export default Header;
